css:
atom-text-editor .gutter[gutter-name='linter-ui-plus'] {
  width: 1.5em;
  -webkit-font-smoothing: antialiased;
}
atom-text-editor .gutter[gutter-name='linter-ui-plus'] .linter-gutter-marker {
  width: 1.5em;
  background: #282c34;
  text-align: center;
}
atom-text-editor .highlights *[class*="linter-highlight"].region {
  border: 1px solid transparent;
  position: absolute;
  z-index: 1;
  border-radius: 2px;
}
atom-text-editor .highlights *[class*="linter-highlight"].region.linter-highlight-error {
  background-image: linear-gradient(45deg, transparent 65%, #c00 80%, #c00 90%, transparent 90%), linear-gradient(135deg, transparent 5%, #c00 15%, #c00 25%, transparent 25%), linear-gradient(135deg, transparent 45%, #c00 55%, #c00 65%, transparent 65%), linear-gradient(45deg, transparent 25%, #c00 35%, #c00 50%, transparent 50%);
  background-size: 8px 2px;
  background-repeat: repeat-x;
  background-position: left bottom;
}
atom-text-editor .highlights *[class*="linter-highlight"].region.linter-highlight-warning {
  background-image: linear-gradient(45deg, transparent 65%, #f78a46 80%, #f78a46 90%, transparent 90%), linear-gradient(135deg, transparent 5%, #f78a46 15%, #f78a46 25%, transparent 25%), linear-gradient(135deg, transparent 45%, #f78a46 55%, #f78a46 65%, transparent 65%), linear-gradient(45deg, transparent 25%, #f78a46 35%, #f78a46 50%, transparent 50%);
  background-size: 8px 2px;
  background-repeat: repeat-x;
  background-position: left bottom;
}
atom-text-editor .highlights *[class*="linter-highlight"].region.linter-highlight-info {
  background-image: linear-gradient(45deg, transparent 65%, #5293d8 80%, #5293d8 90%, transparent 90%), linear-gradient(135deg, transparent 5%, #5293d8 15%, #5293d8 25%, transparent 25%), linear-gradient(135deg, transparent 45%, #5293d8 55%, #5293d8 65%, transparent 65%), linear-gradient(45deg, transparent 25%, #5293d8 35%, #5293d8 50%, transparent 50%);
  background-size: 8px 2px;
  background-repeat: repeat-x;
  background-position: left bottom;
}
